import React from 'react';
import '../styles/Footer.css'


function Footer() {

    return (
    <div class="container">
        <div class="footer-center">
        <div className="footer row align-items-center">

            <a className="contact-links col-2" href="https://github.com/MaryiaVinogradova" target="_blank"><i
                className="bi bi-github"></i></a>

            <a className="contact-links col-2" href="https://www.linkedin.com/in/maryiavinogradova/"
                target="_blank"><i className="bi bi-linkedin"></i></a>


        </div>
        </div>
    </div>
    );
}

export default Footer;
